import './App.css';
import HomePageCard from './components/HomePageCard';
import { BrowserRouter, Routes, Route} from "react-router-dom";
import CalculationCard from './components/CalculationCard';
import BuyingCard from './components/ForecastCard';
import NavigationBar from './components/NavigationBar';



function App() {
  return (
    <BrowserRouter>
    <div className="App">
    <NavigationBar/>
      <Routes>

      <Route
      path="/predvidiCenu"
      element={
        <>
        <BuyingCard/>
        </>
      }
        />

        <Route
      path="/proceniNekretninu"
      element={
        <>
        <CalculationCard/>
        </>
      }
        />
      </Routes>
    </div>
    </BrowserRouter>

  );
}

export default App;
